import React from "react";

import "./FinanceForm.css";

const FinanceForm = () => {
  const addFinanceHandler = () => console.log("Add finance");
  const titleChangeHandler = (event) => console.log(event.target.value);

  return (
    <form>
      <div className="new-finance__controls"></div>
      <div className="new-finance__control">
        <label>Title</label>
        <input type="text" onChange={titleChangeHandler} />
      </div>
      <div className="new-finance__control">
        <label>Amount</label>
        <input type="number" min="1" step="1" />
      </div>
      <div className="new-finance__control">
        <label>Date</label>
        <input type="date" min="2019-01-01" max="2022-12-31" />
      </div>
      <div className="new-finance__actions">
        <button onClick={addFinanceHandler} type="submit">
          Add Finance
        </button>
      </div>
    </form>
  );
};

export default FinanceForm;
